INSERT INTO `api_productbase` (`basecode`, `articleID`, `active`, `splitbook`, `pep_class`, `pep_class_qualifier`, `accessClassification`, `wall`, `mainTOC`, `first_author`, `author`, `title`, `bibabbrev`, `ISSN`, `ISBN-10`, `ISBN-13`, `pages`, `Comment`, `pepcode`, `publisher`, `jrnl`, `pub_year`, `start_year`, `end_year`, `pep_url`, `language`, `updated`, `pepversion`, `duplicate`, `landing_page`, `coverage_notes`, `landing_page_intro_html`, `landing_page_end_html`, `google_books_link`, `charcount_stat_name`, `charcount_stat_start_year`, `charcount_stat_group_str`, `charcount_stat_group_count`) VALUES ('ADPSA', NULL, 1, NULL, 'journal', NULL, 'archive', 5, NULL, NULL, NULL, 'Almanach der Psychoanalyse ', 'Almanach d. PsA.', '1018-2756', NULL, NULL, NULL, NULL, 'ADPSA', 'Internationaler Psychanalytischer Verlag\r\n', 1, NULL, 1926, 1938, 'https://pep-web.org/browse/adpsa/volumes', 'DE', '2022-04-07 14:00:14', 2016, NULL, '', NULL, NULL, '<p class=\"toc-journalhint\">The PEP Archive contains the full-text content of all of the volumes above.  Due to contracts with the publishers, there is a three year moving wall (embargo of current articles) for most journals.  You can browse the tables of contents up through the current issue, and searches include the complete text of the articles, but only the titles and abstracts (or summaries) will be displayed for articles from 2013 and newer. For details on how to read the full text of 2013 and more current articles see <a href=\"http://support.pep-web.org/about-the-pep-archive/pep-journals/links-to-journal-publishers/\">Links to Current Content</a>.</p>', NULL, 'ADPSA', 1699, '/ADPSA/', 1);
